public String getOriginalTrackingUrl() {
  this.readLock.lock();

  try {
    if (this.currentAttempt != null) {
      return this.currentAttempt.getOriginalTrackingUrl();
    }
    return null;
  } finally {
    this.readLock.unlock();
  }
}
